Skelbimo tekstas:
Nuomojamas išskirtinis 2 kambarių naujai suremontuotas, moderniai ir jaukiai įrengtas erdvus butas Vilniaus centre, A. Goštauto gatvėje. Didžiausias buto privalumas – strategiškai patogi lokacija ir nuostabus panoraminis vaizdas pro langus.Butas skoningai įrengtas kokybiškomis medžiagomis, nuomojamas su baldais ir nauja buitine technika. Buto išorės sienos iš vidaus yra papildomai apšildytos, todėl bute žiemą šilta, vasarą gaivu, o dėl vidinių sienų papildomos garso izoliacijos - kaimynų beveik visiškai nesigirdi.
Funkcionalus buto išplanavimas leidžia patogiai judėti erdvėje. Drabužinė, koridoriaus spinta, vonios ir virtuvės baldai yra ne tik funkcionalūs, bet ir talpūs.Įvestas internetas ir televizija.
Galimybė automobilį parkuotis kieme ar gretimoje teritorijoje.BUTO IŠPLANAVIMAS 56 kv. m:
- Erdvi svetainė su virtuve;
- Miegamasis;
- Vonios kambarys ir tualetas kartu;
- Didelė erdvi drabužinė.ĮRENGIMAS:
- stilingas skandinaviško stiliaus modernus įrengimas
- kokybiški baldai
- Visa reikalinga kokybiška nauja buitinė technika (indaplovė, dujinė kaitlentė, orkaitė, šaldytuvas, skalbimo mašina, gartraukis);
- Plastikiniai langai,- šarvo tipo durys.ŠILDYMAS:
- Centrinis,
-iš vidaus apšildytos išorės sienos, garso izoliacija nuo kaimynų,
-šildomos vonios kambario grindys.VIETA:
- Strategiškai patogi vieta, labai patogus susisiekimas viešuoju transportu ir nuosavu automobiliu;
- Rami aplinka, ramūs kaimynai;
- Jaukus namo vidinis kiemas;
-nuostabus vaizdas per svetainės ir virtuvės langus į upės pusę;
-miegamojo langai išeina į ramų vidinį kiemą;
- Gyvenantiems aktyvų kultūrinį gyvenimą pėsčiomis lengvai pasiekiami visi labiausiai lankytini kultūros, istorijos ir meno objektai;
- visos galimybės sportuoti kitąpus upės esančiose sporto aikštelėse, bėgioti paupiu, važinėtis dviračiais (prie laiptinės durų yra įrengtos dviračių parkavimo vietos).Butas šiltas žiemą, vėsus vasarą.
Kadangi butas visiškai naujas, atsiprašome, bet gyvūnų priimti negalime.
Bute bei namo laiptinėje nerūkoma.Kadangi butą nuomoja savininkai, nėra tarpininkavimo mokesčio!

Nuo Šeškinės kalvų link žvaigždžių stiebiasi daugiabutis, skirtas žmonėms, taip pat siekiantiems dangaus.
Šalia jokių kaimyninių daugiabučių, todėl iš balkonų kasdien galėsite stebėti visą platųjį žvaigždžių pasaulį, nes dangaus neužstos jokie aukšti pastatai.
Nors dėl gamtos artumo jausitės tarsi gyvendami ne mieste, pagrindiniai miesto objektai čia pat.
Daugumą jų pasieksite pėsčiomis, dviračiu ar elektriniu paspirtuku.Buto privalumai:
 Butas dar kvepiantis dažais - būsite pirmieji gyventojai!
 Pilnai įrengtas, su baldais ir buitine technika (skalbimo mašina, šaldytuvas, indaplovė, orkaitė, kaitlentė, gartraukis, televizorius);
 Grindinis šildymas su automatiniu valdymu (termostatas, wifi);
 Rekuperacijos sistema valdoma valdikliu;
 Oro kondicionierius valdomas pulteliu ir wifi;
 Erdvus balkonas - 10,22 kv.m.;
 Kieme visuomet yra vietos automobiliui;
 A energinė klasė - itin mažos išlaidos šildymui ir visuomet šilti namaiProjekto privalumai:
Butas nuomojamas projekte “Paukščių takas”.
Būsimiems gyventojams projektas siūlo balansą tarp miesto šurmulio ir gamtos atokvėpio.
Bendra stogo terasa. Unikalia gamtos, dangoraižių ir TV bokšto panorama galėsite mėgautis ir iš bendros stogo terasos. Kai pritrūks įkvėpimo, 360° miesto vaizdasJūsų paslaugoms.
Laisvalaikis prie namų. Mėgstantiems sportuoti daugybė galimybių! Sporto klubas - artimiausias kaimynas. Prie pat namų pasivaikščiojimo takai, vedantys link Žvėryno. Už kelių šimtų metrų - SEB sporto arena, futbolo bei ledo arenos. Apsigyvenus čia, pradėsite gyventi aktyviau net patys to nepastebėję!Susisiekimas
Butas bene patogiausioje miesto vietoje, nes iš čia kitų miesto rajonų pakraščiai gali būti pasiekiami per 10 minučių kelionės automobiliu. O kelionė iki miesto centro truks vos 5 minučių.
Didieji prekybos centrai „Akropolis”, „Ozas”, „Panorama” vos už 2 - 4 minučių.Minimalus nuomos terminas - 1 metai, užstato dydis - 1 mėnesio nuomos kaina.Turime daugiau, skirtingų dydžių ir kainų, butų nuomai.

