Erdvus butas su vaizdu į senamiestįNuomojamas moderniai ir jaukiai ką tik įrengtas erdvus butas Senamiestyje, Mindaugo Gatvėje, prie Mindaugo Maximos. Vos kelios minutės nuo miesto centro, Gedimino prospekto ar kitos senamiesčio vietos. Vaizdas pro langą į senamiesčio pusę.BUTO IŠPLANAVIMAS 61kv.m:
-- Erdvi svetainė su miegamuoju;
-- Atskira erdvė virtuvei;
-- Vonios kambarys ir tualetas kartu;
-- Didelė erdvi įmontuojama spinta.ĮRENGIMAS:-- Visi baldai bute yra;-- Visa reikalinga buitinė technika (Skalbimo mašina, džiovyklė, kaitlentė, orkaitė, šaldytuvas);-- Bilijardo stalas, 6 kolonėlių ervinio garso sistema, projektorius;
-- Plastikiniai langai, šarvo durys, laiptinėje yra veikianti vaizdo stebėjimo kamera;
-- Kondicionierius.ŠILDYMAS:-- Centrinis kolektorinis, kiekvienas radiatorius reguluojasi atskirai, šildomos vonios kambario grindys.PARKINGAS:-- Yra galimybė turėti požeminę parkavimo aikštelę, patekimas į ją tiesiai iš laiptinės lifto + 60eVIETA:-- Strategiškai patogi vieta, patogus susisiekimas viešuoju transportu ir nuosavu automobiliu;-- Rami aplinka, ramūs kaimynai;
-- Atskiras namo vidinis kiemas.Bute nerūkoma.

