Vilnius, Fabijoniškės, Salomėjos Nėries g., 2 kambarių buto nuoma SU PARKINGU (įskaičiuotas į buto kainą)BUTAS LAISVAS NUO 2023.01.01.Išnuomojamas šviesus ir šiltas, jaukus dviejų kambarių butas su automobilio parkavimo vieta po stogu.Nuomojantis ilgesniam nei 1 metų laikotarpiui buto kartu su parkingu nuoma - 520 EUR/mėn!
Pageidautina dirbanti pora be augintinių.IŠPLANAVIMAS:-Prieškambaris;
-Virtuvė ir svetainė kartu;
-Atskiras miegamasis;
-Vonios kambarys ir wc kartu.ĮRENGIMAS IR BALDAI:- Visa reikalinga buitinė technika (šaldytuvas, indaplovė, kaitlentė, orkaitė, gartraukis, skalbimo mašina);
- Didelė (įeinama) drabužinė su veidrodžiu prieškambaryje;
- Didelė spinta miegamajame;
- Miegamojo dvigulė lova su nauju čiužiniu;
- Visame bute kokybiškos ąžuolo parketlentės;
- Daug šviesos šaltinių, kokybiški šviestuvai;- Visi buto langai orientuoti į pietų pusę;
- Plastikiniai langai (sumontuoti naktiniai roletai, miegamajame - markizė);
- Didelis, tvarkingas, plytelėmis išklotas 17 m2 balkonas (neįeina į bendrą buto kvadratūrą);
- Rakinama laiptinė (aukšte TIK 3 butai);
- Internetas, TV;- Šarvuotos durys, priešgaisrinė signalizacija.ŠILDYMAS- Autonominis/kolektorinis/dujinis;
- Šildymas reguliuojamas kiekvienam kambaryje atskirai. Butas orientuotas į pietus, todėl net ir žiemą yra labai šiltas.PARKAVIMASErdvi, uždara parkavimo vieta po stogu.
VIETA- Netoliese esantis vakarinis aplinkelis leidžia patogiai susisiekti su miesto centru ir kitais Vilniaus rajonais tiek asmeniniu, tiek ir viešuoju transportu (stotelė vos už kelių žingsnių);
- Kieme yra kelios vaikų žaidimo aikštelės, darželiai, mokykla;
- Rugsėjo mėnesį duris atvers naujausias Vilniaus baseinas;
- Netoli miškelis – parkas, puikūs pasivaikščiojimo takai;
- Tvarkingi ir ramūs kaimynai;Dėl apžiūros skambinkite Jums patogiu laiku (butas nuomojamas be tarpininkų ir vienkartinių agentūrų mokesčių!!!).

Ilgam laikui (1 m. ir ilgiau) nuomojamas jaukus ir šviesus 2 kambarių butas Šiaurės miestelyje, S. Žukausko gatvėje. Butas tinkamas gyventi vienam arba dviese.Neseniai atliktas buto remontas, naujai įrengta virtuvė su kokybiška buitine technika, o už lango atsiveria puikūs vaizdai.BUTO PRIVALUMAI:
* Suremontuotas;
* Erdvus, patogiai suplanuotas;
* Puiki vieta, patogus susisiekimas;
* Nedidelės išlaikymo išlaidos;
* Tvarkinga kaimynystė;
* Aplink namų kompleksą visuomet galima rasti vietos automobiliui.BENDRA INFORMACIJA:
* Plotas: 51,16 kv. m.;
* Kambarių skaičius: 2;
* Aukštas: 4/5;
* Šildymas: centrinis - kolektorinis su individualiu reguliavimu.ĮRENGIMAS:
* Pilnai įrengtas, su baldais ir buitine technika, indais bei stalo įrankiais.
* Šaldytuvas;
* Orkaitė;
* Kaitlentė;
* Mikrobangų krosnelė;
* Gartraukis;
* Indaplovė;
* Skalbimo mašina;
* Rankšluosčių džiovyklė;* Pianinas;
* Televizorius (Smart TV);
* Drabužinė ir didelė spinta su stumdomis durimis;
* Erdvus ~5 kv. m. balkonas su gultu ir vaizdu į pušyną bei Nerį;* Šildomos grindys vonioje.Tiesiogiai - nuomojama be tarpininkų, BUTAS JAU LAISVAS.VIETA:
* Greta įsikūrę prekybos centrai: Maxima, Iki, Senukai, RIMI, JYSK, TOPO-centras, Lidl. Šalia taip pat rasite kelias vaistines, odontologijos klinikas, NORTHWAY medicinos centrą, masažo ir grožio salonus. Kaimynystėje yra sporto klubai, kavinės, barai ir padruotuvių bei laisvalaikio pramogų centras OGMIA Miestelis;
