* Mėgstantiems pasivaikščioti ir aktyvų sportą – netoliese naujai nutiesti dviračių ir pėsčiųjų takai iki pat centro ar palei Neries krantinę.

Išnuomojamas išskirtinio interjero 25 kv/m, labai gerai įrengtas ir patogiai suplanuotas vienokambario (studio tipo) butas naujame Renesanso projekte.Butui priklauso parkinge esantis sandėliukas 4.3 kv/m. Atidarius buto langą matosi Gedimino pilis.Butas bus laisvas nuo 2023.06.01.Tai - unikalus, naujas, A+ energetinės klasės, mažaaukštės statybos butas atgimstančioje Vilniaus Senamiesčio dalyje Sodų gatvėje. Butas įrengtas 2022 m. rugsėjo mėn.Interejero dizainerės projektuotas ir kokybiškai įrengtas naujas butas su visais reikalingais baldais, bei buitine technika. Taip pat bute yra sukomplektuoti visi reikalingi indai ir aksesuarai, patalynė ir rankšluoščiai, ieškantiems jaukių ir patogių namų ir norintiems įsikelti tuoj pat.IŠPLANAVIMAS:
Svetainė kartu su virtuve ir patogia sofa – lova, yra valgomasis stalas su kėdėm ir TV, bei erdvė su lentyna;
Virtuvės dalyje įrengta indaplovė, šaldytuvas, kaitlentė ir gartraukis;
Prieškambaryje įrengta talpi spinta lauko rūbams, vidaus daiktams ir patalynei bei įmontuota skalbimo mašina ir drabužių džiovyklė;
Bute rasite viską, ko reikia kasdieniniam gyvenimui, stilingus stalo įrankius bei indus. Visus virtuvės įrankius ir priedus.
Vonios kambarys ir tualetas kartu;
Bute rasite visiškai naujus kokybiškos medvilnės rankšluosčius, patalus, pagalves ir patalynės užvalkalus paruoštus pirmiem gyventojams.
PRIVALUMAI:
Aukštos lubos (3,10 m.) suteikia erdvės pojūtį ir komfortą, o dideli mediniai langai suteikia šviesos ir jaukumo;
Išskirtinio dizaino butas, įrengtas kokybiškomis medžiagomis;
Reguliuojamas dviejų zonų grindų šildymas leidžia tolygiai paskirstyti šilumą po visa butą;
Galingi ir tylūs ventiliatoriai vonioje ir koridoriuje užtikriną nuolatinę šviežio oro cirkuliaciją patenkančią iš lauko per oro padavimo sklendę bei filtrus.
Vaizdo kameromis stebima, uždara ir saugi teritorija;
Uždaras kiemas su žaidimų aištele;
Puiki infrastruktūra - šalia Halės turgus, Vilniaus centrinė stotis, parduotuvės ir ugdymo įstaigos.
PARKAVIMAS:
Yra galimybė buto gyventojams iš savivaldybės už simbolinį mokęstį išsinuomoti automobilio parkavimo vieta šalia namų geltonoje zonoje.
VIETA:
Butas įsikūręs autentiškame Vilniaus Senamiestyje, atgimstančioje dalyje šalia Pylimo g., šalia kurios gausu kultūros ir pramoginių erdvių.

Išnuomojamas, naujas, puikiai išplanuotas, interjero dizainerės labai gerai įrengtas, jaukus 2 kambarių butas Vilniaus senamiestyje “Bastėja Life” projekte, tarp Šv. Dvasios ir Strazdelio gatvių. Įrengimo darbai baigti 2022 m. rugsėjo mėn. A energetinio efektyvumo klasė, maži komunaliniai.Butas bus laisvas nuo 2023.06.01.IŠPLANAVIMAS:
- Erdvi svetainė su virtuve ir langais į vidinį kiemą;
- Jaukus miegamasis su patogia darbo vieta ir drabužių spinta;
- Vonios kambarys ir tualetas.
ĮRENGIMAS:
- Interejero dizainerės projektuotas ir kokybiškai įrengtas butas su visais reikalingais baldais, visa buitine technika ieškantiems jaukių ir patogių namų;
- Bute rasite viską, ko reikia kasdieniniam gyvenimui: stilingus stalo įrankius, virdulį, indus, puodus ir keptuvę, puodelius, kavinuką, taures, stiklines, visus virtuvės įrankius ir priedus (atidarytuvą, samtį, žirkles, peilius, padėkliukus, šluostes, indus maisto gamybai ir kt.);
- Virtuvėje įrengta indaplovė, šaldytuvas, kaitlentė ir orkaitė bei gartraukis;
