Naujos statybos, išskirtinio dizaino, prestižinis būstas senamiestyje. 2021 metų mažaaukštės statybos projekte pačioje Vilniaus miesto širdyje. Uždaras jaukus ir tylus kiemas su vartais ir stebėjimo kameromis užtikrina saugumą ir ramybę. Vidiniame kieme sukurtos poilsio erdves tiek vaikams, tiek suaugusiems. Butas yra antrame aukšte iš trijų su balkonu, kuriame galėsite mėgautis rytine kava, puikiu vaizdu į vidinį kiemą. Visi langai nukreipti į pietus tad butas šviesus ir šiltas visą dieną. Lubų aukštis virš trijų metrų sukuria ypatingą erdvės pojūtį. Virtuvės ir kambario baldai išsiskiria aukšta kokybe ir erdvumu tad tikrai yra daugiau negu pakankamai vietos jūsų daiktams. Visiškai nauja aukštos klasės buitinė technika: tylus ir erdvus įmontuojamas šaldytuvas, orkaitė ir indaplovė, smart skalbyklė-džiovyklė. Grindinis kolektorinis šildymas užtikrina žemas komunalines išlaidas net ir žiemos mėnesiais.PRIVALUMAI:- Jauki kaimynystė (prestižinės klasės būstas);
- Mažos šildymo sąnaudos, naujas namas;- Gražiausio fasado laimėtojas 2021 (https://renesanso.lt/graziausias-fasadas-2021);
- Išskirtinis dizainas, kokybiškos medžiagos;- Aukštos lubos (3m) suteikia erdvės pojūtį ir komfortą, o dideli mediniai langai suteikia šviesos ir jaukumo;- Reguliuojamas dviejų zonų grindų šildymas leidžia tolygiai paskirstyti šilumą po visa butą;
- Jaukios natūralaus ažuolo parketo grindys, nuotaikos LED apšvietimo sprendimai;
- Daug vietos daiktams (erdvūs 3 metrų aukščio baldai);- Kokybiška nauja buitinė technika (šaldytuvas, orkaitė, kaitlentė, indaplovė, skalbimo mašina, gartraukis);- Vaizdo kameromis stebima, uždara ir saugi teritorija;- Uždaras kiemas su žaidimų aištele;- Funkcionalus ir gražus vidinis kiemas, nuostabus vaizdas pro balkono langus;
- Langai į kiemą, visiškai privatu, jauku, tylu;- Požeminėje dalyje yra nemokama rakinama bendro naudojimo dviračių saugykla;- Liftas;
- Puiki infrastruktūra - šalia Halės turgus, Vilniaus centrinė stotis, parduotuvės ir ugdymo įstaigos.- Butas yra autentiškame Vilniaus Senamiestyje, kur gausu kultūros ir pramoginių erdvių. Penkios minutės pėsčiomis iki Rotušės.PARKAVIMAS: Yra galimybė buto gyventojams iš savivaldybės už simbolinį mokęstį išsinuomoti automobilio parkavimo vietą šalia namų geltonoje zonoje. Taip pat už papildomą mokestį galima išsinuomoti vietą požeminiame parkinge.Butas gali buti nuomojamas ir trumpesniam laikotarpiui nei metai. Depozitas pusantro mėnesio nuomos dydžio.

