Nuomojamas šviesus, jaukus bei visiškai naujai įrengtas ir laukiantis pirmųjų gyventojų dviejų atskirų kambarių butas Viršuliškėse, Viršuliškių gatvėje. 9 aukštų namas, butas 5 aukšte. Kodinės laiptinės durys, namas nerenovuotas, laiptinė reikalaujanti teptuko ir dažų :) Butas orientuotas į pietvakarių pusę. Palei langus siūbuoja ilgamečiai beržai, tad pavasarį sulapoję jie užstoja gatvę ir suteikia jaukumo. Butas ribojasi su ilgalaikiais kaimynais, todėl kaimynystė yra saugi ir rami.Apie butą ir jo įrengimą:- butas išklotas aukštos kokybės laminuotomis grindimis. Kambariuose ir virtuvėje - stiklo paketų langai. Bute įstatytos medinės durys. Sienos dažytos;
- užėję į butą pateksite į svetainę. Joje rasite trivietę sofą, TV konsolę, stiklinį staliuką bei interjero detales (toršerą, kilimą, pledų krepšį). Svetainės langus dengia dieninės užuolaidos;
- koridoriuje įrengta sieninė spinta su stalčiais, antresolinėmis lentynomis, drabužių kabyklomis bei ilgaaulių ir trumpaaulių batų skyriais. Koridoriuje taip pat rasite platų veidrodį “rodantį” visu ūgiu;
- virtuvėje - baldų komplektas su BLUM furnitūra bei integruota buitine technika: indaplove, skalbimo mašina, orkaite, dujine kaitlente bei gartraukiu. Indauja, stalčius stalo įrankiams, stalčiai puodams, spintelės iki lubų bei dviejų pusių stalviršiai leis patogiai talpinti produktus bei suktis virtuvėje. Medinės perdirbto medžio taburetės - stilingas šių namų virtuvės akcentas. Langą dengia romanetė;
- vonia išklota akmens masės plytelėmis. Įrengtas įeinamas dušas su grūdinto stiklo sienele bei termostatiniu maišytuvu. Perkėlus skalbimo mašiną į virtuvę atlaisvinome erdvę vonios patalpoje patogiai įtaisyti skalbinių krepšį ar nedidelį suolelį;
- miegamajame - ąžuolo faneruotės naktiniai staliukai, komoda bei dvigulė lova su čiužiniu (160x200). Įrengta talpi sieninė spinta stumdomomis durimis. Langus dengia dieninės užuolaidos bei portjeros;
- iš miegamojo pateksite į erdvų bei įstiklintą balkoną, išklotą laminuotomis grindimis;
- butas yra puikioje pozicijoje - autobusų stotelės, Maxima ir Iki parduotuvės, sporto klubas bei prekybos centras yra visai šalia namo. Patogus susisiekimas su miesto centru;
- niekuomet nėra bėdų dėl automobilio parkavimo, nes vietų kieme bei prie namo yra pakankamai.Tai labai jaukus ir komfortiškas butas. Pasivaikščiojimo takai šalia esančiame ir pro langus matome pušyne; ūkininkų turgelis; netoliese esantis sporto klubas; “ranka pasiekiamas” miesto centras bei patogus susisiekimas. Pats butas yra neįtikėtinai jaukus.Butas nenuomojamas gyventi su mažamečiais vaikais bei gyvūnais.Kviečiame atvykti, apžiūrėti ir patiems įvertinti.NEKILNOJAMO TURTO AGENTŲ PRIMYGTINAI PRAŠOME NESKAMBINTI

